import React, { Component } from 'react';

import axios from 'axios';


class HomeContainer extends Component {

    componentDidMount() {
        axios.get('https://pokeapi.co/api/v2/pokemon/').
            then(result => {
                console.log(result)
                this.setState({ pokemon: result.data })
            }).catch(console.log);
    }


}
export default HomeContainer;
